  border-radius: 4px;
  overflow: visible;
  white-space: normal;
  text-indent: initial;
  -webkit-box-shadow: 0 0 6px 0 rgba(0,0,0,0.2);
  box-shadow: 0 0 6px 0 rgba(0,0,0,0.2);
  -webkit-transition: all 0.3s ease-out;
  transition: all 0.3s ease-out;
/* Position the tooltip */
  bottom: calc(100% + 8px);
  transform: translate(0, -20px);
  left: 0;
  margin-left: 0;
}
