functions.createAccordionCategories = function(){
  if($('body').hasClass('spec--npnl-subcategory-listing')||$('body').hasClass('spec--npnl-part-number-listing')) return;
  var accCategories = document.getElementsByClassName('m-h3');
  for (var i = 0; i < accCategories.length; i++) {
    $(accCategories[i]).unbind();
    $(accCategories[i]).bind('click', function() {
      if(window.innerWidth <= vonaLight.objects.responsive.getTabletTransitionWidth()) {
        /*close other open tabs*/
        for(var j = 0; j < accCategories.length; j++) {
          $(accCategories[j]).not($(this)).next().css('max-height',0);
          $(accCategories[j]).not($(this)).removeClass('active');
        }

        $(this).toggleClass('active');
        if($(this).hasClass('active')){
          $(this).next().css('maxHeight', 'none');
        }
        else{
          $(this).next().css('maxHeight',0);
        }
      }
    });
  }
};/* end accordion Categories */

functions.createAccordionSpec = function(){
  var accCategories = $('[data-spec="checkboxform"] .m-h2Wrap--function');
  var bodySpecOrSearchClass = $('.result').length+$('.spec').length;/*condition to execute only on spec or search pages*/

