        }
        else{
          $(this).next().css('maxHeight',0);
        }
      }
    });
  }
};/* end accordion Spec */

functions.dimContent = function(options) {
  if(!options) options = { hideOverlay: false, onHide: null };

  function reposition() {
    var $ref = $('.l-header__searchForm');
    if ($ref[0] && $ref[0].getBoundingClientRect) {
      var rect = $ref[0].getBoundingClientRect();
      var offset = 0;
      var width = $(window).width();
      if (width <= 768) offset = 15;
      else if (width <= 881) offset = 24;
      else if (width <= 991) offset = 21;
      else if (width <= 1199) offset = 25;
      else offset = 30;
      var top = rect.top + rect.height + offset;
      $('.VNmodalDim').css({top: top});
    }
  }

  var CLICK = 'click.dimContent';
  var SCROLL = 'scroll.dimContent';
  var RESIZE = 'resize.dimContent';

  function hide() {
    $('.VNmodalDim').fadeOut( 200, 0, function() {
      // Animation complete.
      $(window).off(SCROLL).off(RESIZE);
      $('body').removeClass('is-dimContent');
      $('.VNmodalDim').remove();
      if(options.onHide) options.onHide();
    });
  }

  if(options.hideOverlay) return hide();

  //on document click or close remove
  $(document).off(CLICK).on(CLICK, hide );
  $('.VNmodalDim').off(CLICK).on(CLICK, hide);
  $(window).off(SCROLL).on(SCROLL, reposition);
  $(window).off(RESIZE).on(RESIZE, reposition);

  if($('body').hasClass('is-dimContent')){
    // Do nothing if class exists

  } else {
    // Do something if class does not exist
    //add class and covering div 
    $('.l-headerWrap').append("<div class='VNmodalDim'><button class='m-btn--close' aria-label='close'>x</button></div>");
    $('body').addClass('is-dimContent');
    reposition();
    $('.VNmodalDim').fadeTo(100, 1);
  }
};
functions.ga4SendEvent = function ga4SendEvent(eventName, data, cb, startTime) {
  var MAX_TIMEOUT = 8000;
  var curTime = (new Date).getTime();
  if(!startTime) startTime = curTime;

  // get an actual arguments object
  function gtagCall() {return arguments;}

  try {
    var ids = [];
    if (window.google_tag_manager) {
      for (var key in window.google_tag_manager) {
        if (key.substring(0,2) == 'G-') {
          ids.push(key);
        }
      }
    }

    if (!ids.length) {
      if((curTime - startTime) >= MAX_TIMEOUT){
        if(cb) cb();
        return;
      }
      return setTimeout(function(){ ga4SendEvent(eventName, data, cb, startTime); }, 100);
    }

    var user_properties = {
      u_user_cd: (functions.getCookieValue('CUSTCD') || '').toString(), // yes, it's CUSTCD that has the value of userInfo.userCode
      u_cust_cd: functions.getCookieValue('VONAEC_CCD') || '',
    };
    window.dataLayer.push(gtagCall('set', 'user_properties', user_properties));

    for(var i=0;i<ids.length;i++){
      var eventData = JSON.parse(JSON.stringify(data));
      eventData.send_to = ids[0];
      eventData.sid = (functions.getCookieValue('GACCESSTOKENKEY') || '').slice(0,100);
      if (functions.getCookieValue('DEV')) console.log(eventName, eventData, user_properties); //eslint-disable-line no-console
      var ga4map = { brand_code: 'e_brand', category_code: 'e_top_category', keyword: 'e_search_keyword', series_code: 'e_seriescd', inner_code: 'e_inner', action: 'e_action', part: 'e_codefix', timestamp: 'unix_tm' };
      for(var prop in ga4map){ if(prop in eventData){ eventData[ga4map[prop]] = eventData[prop]; delete eventData[prop]; } }
      window.dataLayer.push(gtagCall('event', eventName, eventData));
      if(window.sessionStorage && sessionStorage.getItem('__ga4_debug')) console.log('GA Event '+eventName+'-'+JSON.stringify(eventData)); //eslint-disable-line no-console
    }
  } catch (e) {
    console.error(e); //eslint-disable-line no-console
  }
  if(cb) setTimeout(cb, 50);
};
functions.gaSendEvent = (function(){
  var queuedFuncs = [];

  //Wait until the Google Analytics object is available before running the task
  var gaFunc = function gaFunc(_f){
    var ga_all = (window.ga&&window.ga.getAll?window.ga.getAll():null);
    if(ga_all && ga_all.length){
      if(queuedFuncs.length){
        var toRun = queuedFuncs;
        queuedFuncs = [];
        for(var i=0;i<toRun.length;i++) toRun[i](ga_all[0]);
      }
      if(_f) _f(ga_all[0]);
    }
    else {
      if(!_f) window.setTimeout(gaFunc, 100);
      else {
        queuedFuncs.push(_f);
        if(queuedFuncs.length==1){ window.setTimeout(gaFunc, 100); }
      }
    }
  };

  //Send an event to Google Analytics
  var gaSendEvent = function gaSendEvent(eventCategory, eventAction, eventLabel, eventValue, options, cb){
    if(!eventLabel){
      eventLabel = '';
      if(VNServerInfo && VNServerInfo.partNumberData && (VNServerInfo.partNumberData.length==1)){
        eventLabel = VNServerInfo.partNumberData[0].partNumber;
      }
    }
    if(!eventLabel) eventLabel = '';
    eventLabel = eventLabel.trim();
    if(eventLabel.length > 500) eventLabel = eventLabel.substr(0,497)+'...';

    if(!eventValue) eventValue = 0;
    gaFunc(function(_ga){
      var eventData = {
        eventCategory: eventCategory,
        eventAction: eventAction,
        eventLabel: eventLabel,
        eventValue: Math.round(eventValue),
        transport: 'beacon'
      };
      if(options && options.nonInteraction) eventData.nonInteraction = true;
      _ga.send('event', eventData);
      if(cb) cb();
    });
  };

  gaSendEvent.gaFunc = gaFunc;
  return gaSendEvent;
}());
