// Get an individual Google Experiment
functions.getGoogleExperiment = function(experimentName, params) {
  var experiments = window.VN_google_experiments || {};
  var experiment = experiments[experimentName] || (window.vonaLight && vonaLight.config && vonaLight.config.google_experiments && vonaLight.config.google_experiments[experimentName]);
  if(experiment.duration_type == 'manual'){
    if(experiment.loadExperiment_clientjs) eval('(function(experiment, params){'+experiment.loadExperiment_clientjs+'}).call(null, experiment, (params||{}))');
  }
  return experiment;
};
