  'vona2/settings',
];
// Get the Google Experiment Variations cookie data
functions.getGoogleExperimentsCookie = function() {
  var strExperiments = vonaLight.functions.getCookieValue('GOOGLE_EXPERIMENTS')||'___'; //EX1NAME:ID1:VARIATION1|EX2NAME:ID2:VARIATION2
  strExperiments = strExperiments.substr(3);
  var experiments = {};
  var lines = strExperiments.split('|');
  for(var i=0;i<lines.length;i++){
    var items = lines[i].split(':');
    if(items.length != 3) continue;
    experiments[items[0]] = { id: items[1], variation: items[2] };
  }
  return experiments;
};
functions.getGoogleExperimentsCookie.depends = [
  'functions/getCookieValue',
];
// Get an individual Google Experiment Variation
functions.getGoogleExperimentVariation = function(experimentName, params) {
  var experimentsCookie = vonaLight.functions.getGoogleExperimentsCookie();
  var experiment = vonaLight.functions.getGoogleExperiment(experimentName, params);
  if(!experiment) return 0;

  var rndDist = experiment.random_distribution;

  var experimentVariation = (experimentsCookie[experimentName] && experimentsCookie[experimentName].variation)||experiment.variation||null;
  if(!experimentVariation){
    if(rndDist && (rndDist.type=='uniform')){
      var a = rndDist.a;
      var b = rndDist.b;
      experimentVariation = Math.floor((Math.random()*(b-a+1))+a);
      if(experimentVariation > b) experimentVariation = b;
    }
    else experimentVariation = 1;
    vonaLight.functions.setGoogleExperimentVariation(experimentName, experimentVariation);
  }
  return experimentVariation||0;
};
functions.getGoogleExperimentVariation.depends = [
  'functions/getGoogleExperiment',
  'functions/getGoogleExperimentsCookie',
  'functions/setGoogleExperimentVariation',
];
// From specified URL string, retrieves the query parameters and the URL which excludes the query parameters.
functions.getURLAndParams = function(url) {
  var separateUrl, paramString, paramLength, params, param, name, value;
  if (url.match(/^(.+?)\?([^#]+)/)) {
    separateUrl = RegExp.$1;
    paramString = RegExp.$2.split('&');
    paramLength = paramString.length;
    params = {};
    for (var i = 0; i < paramLength; i++) {
      param = paramString[i];
      if (param.match(/^(.+?)=(.+)$/)) {
        name = RegExp.$1;
        value = RegExp.$2;
        value = value.replace(/\+/g, '%20');
        if (name && value) {
          params[name] = decodeURIComponent(value);
        }
      }
    }
    return {
      url: separateUrl,
      params: params
    };
  } else {
    return {
      url: url,
      params: {}
    };
  }
};

// Retrieves the parameter value of URL.
functions.getURLParamValue = function(param) {
  var params, neet, paramsArray;
  params = location.search.substring(1).split('&');
  neet = [];
  paramsArray = [];

  for (var i = 0, length = params.length; i < length; i++) {
    neet = params[i].split('=');
    paramsArray.push(neet[0]);
    if( neet.length >= 2 ) paramsArray[neet[0]] = decodeURIComponent(neet[1].replace(/\+/g, '%20'));
  }

  return paramsArray[param] ? paramsArray[param] : '';
};

