functions.renderHtmlList = function renderHtmlList($container, $template, items, setter) {
  var $children = $container.children();
  var childCount = $children.length;
  var itemCount = (items && items.length) || 0;
  var matching = Math.min(childCount, itemCount);
  var i;

  // update matching children
  for (i = 0;i < matching;i++) {
    //console.log('match', i);
    setter(i, items[i], $($children[i]));
  }

  // add new items
  for (i = matching;i < itemCount;i++) {
    //console.log('add', i);
    var $el = $template.clone();
    setter(i, items[i], $el);
    $container.append($el);
  }

  // remove excess children
  for (i = matching;i < childCount;i++) {
    //console.log('remove', i);
    $($children[i]).remove();
