// Stores the specified value in cookie.
functions.setCookieValue = function(name, value, expires, path, domain) {
  var ecweb = (window.vona2 && vona2.config && vona2.config.ecweb);
  if( !path  ){
    path = (ecweb && ecweb.catalog_first_directory && ecweb.catalog_first_directory.path) || '/vona2/';
    if( !path.match(/\/$/) ) path += '/';
  }
  if( (''+expires).match(/^[\d.]+$/) ){
    expires = new Date(+new Date() + parseInt(60 * 60 * 24 * 1000 * expires));
  }
  var opt = {};
  if( expires === null ) opt.expiresAt = null;
  else if( expires ) opt.expiresAt = expires;
  if( path === null ) opt.path = null;
  else if( path ) opt.path = path;
  if( domain === null ) opt.domain = null;
  else if( domain ) opt.domain = domain;
  else opt.domain = (ecweb && ecweb.cookie && ecweb.cookie.gAccessTokenKeyDomain) || ('.'+location.host.split('.').slice(-2).join('.')); 
  $.cookies.set(name, value, opt);
};

// Set Google Experiment Variation
functions.setGoogleExperimentVariation = function(experimentName, variation) {
  var experiment = vonaLight.functions.getGoogleExperiment(experimentName);
  if(!experiment) return;

  //Generate ID and write cookie
  var experimentId = Date.now().toString() + '_' + Math.round(Math.random()*1000000000).toString();
  experiment.id = experimentId;
  experiment.variation = variation;

  //Update cookie
  if(!experiment.duration_type || (experiment.duration_type == 'id_series_session') || (experiment.duration_type == '30_cookie')){
    var experimentsCookie = vonaLight.functions.getGoogleExperimentsCookie();
    experimentsCookie[experimentName] = { id: (!experiment.duration_type || (experiment.duration_type == '30_cookie')) ? experimentId : '', variation: variation };
    var experimentStr = '';
    for(var key in experimentsCookie){
      var cookieValue = experimentsCookie[key];
      experimentStr += (experimentStr ? '|' : '') + key + ':' + cookieValue.id + ':' + cookieValue.variation;
    }
    vonaLight.functions.setCookieValue( 'GOOGLE_EXPERIMENTS', '___'+experimentStr, 30, '/' );
  }

  //Update sessionStorage
  if(experiment.duration_type == 'id_series_session'){
    sessionStorage.setItem('__experimentId_'+((VNServerInfo&&VNServerInfo.seriesCode)||'')+'_'+experimentName, experiment.id);
  }

  //Trigger GA event
  var eventParams = {
    action: experimentName,
    value: variation || 0,
    tag: experimentId,
    unix_tm: (new Date()).getTime().toString(),
  };
  if(VNServerInfo){
    eventParams.category_code = VNServerInfo.categoryCode;
    eventParams.series_code = VNServerInfo.seriesCode;
    eventParams.brand_code = VNServerInfo.brandCode;
  }
  vonaLight.functions.ga4SendEvent('ECExperimentStart', eventParams);
};
