/* JS for Back Button History */

//Page and Element prototypes are defined here for vonaLight pages (echistory_category) and then aliased as properties for use outside vonaLight.

//Page that will have back button history enabled
// eslint-disable-next-line no-unused-vars,no-redeclare
var echistoryPage = function(options){
  //isActive: Returns whether or not the page is currently active.  Should be overridden by implementations
  this.isActive = function(){ return false; };
  //isReady: Returns whether or not the page is currently active and sufficiently initialized to return usefull data
  // ex: spec_ext will be missing pageSize and unitType if called too early.
  this.isReady = function(){ return this.isActive(); };
  //elements: Collection of echistoryElement objects
  this.elements = [];
  //opId: Unique operation ID used to sync event
  this.opId = 0;
  //Apply initialization parameters
  $.extend(this, options);
};

//Page element whose state will be stored in the history
// eslint-disable-next-line no-unused-vars,no-redeclare
var echistoryElement = function(options){
  //name: the ID of the element
  this.name = '';
  //type: querystring, querystring_newstate, memory, memory_fast
  this.type = 'memory';
  //updateOn: Array of VONA2 Events that will trigger saving the state
  //          If updateOn is a function, it will be executed once on page ready - it should connect any events at that point
  //          If updateOn == "CREATESTATE", it's value will be constant, and set when the state is first created
  this.updateOn = [];
  //restoreOn: When the state will be restored
  this.restoreOn = ['back','forward','undefined'];
  //getState: Returns a state object for the variable.  If undefined, do not add it to the state
  this.getState = function(){ return undefined; };
  //setState: Restore the state, and wait for the restore to complete
  //          If set to a function, call cb() on completion or error.
  //          If set to a string (element name), the target element handles the restore operation
  this.setState = function(newState, dir, cb, fullState){ return cb(); };
  //stateUnchanged: state will not be restored.
  //  ex: a search result event for the static page results where echistory will not trigger a new search.
  this.stateUnchanged = undefined;//function(newState, dir, fullState){ };
  //opId: Element opId as related to Page opId - Used to check if element restore is in progress
  this.opId = 0;
  //local: Local variables
  this.local = { };
  //Apply initialization parameters
  $.extend(this, options);
};

//VONA2 Class
var echistoryClass = function(){
  var MAX_NAV_ID = 'MISUMI_MAX_NAV_ID';
  var CURRENT_NAV_ID = 'MISUMI_CURRENT_NAV_ID';

  var instance = this;
  var f = vonaLight.functions;

  this.echistoryPage = echistoryPage;
  this.echistoryElement = echistoryElement;

  this.init = function(){ };
  this.initLight = function(){ };
  this.initialized = false;
  //Log messages and display the debugging window
  this.debugEnabled = false;
  //Most recent history state
  this.lastState = { _initial: true };
  this.lastUrl = window.location.href;
  //Array of echistoryPage objects
  this.pageConfig = {};
  //Names of elements currently being restored
  this.restoring = [];
  this.pages = [];

  function getVona() {
    if (window.vona2 && window.vona2.functions) return window.vona2;
    else if (window.vonaLight_Spec) return window.vonaLight_Spec;
  }

  this.getCurrentHistoryId = function(){
    return ((history.state&&history.state.historyId)?history.state.historyId:1);
  };

  //Ready event - fired on when page is loaded
  this.readyLight = function(){
    if(!instance.isEnabled()) return;
    instance.debugEnabled = vonaLight.DEV || (window.vona2 && window.vona2.DEV) || vonaLight.functions.getCookieValue('DEV');
    window.onpopstate = echistory_popstate;

    vonaLight.objects.echistory.addPageConfig(null, {
      category: vonaLight.objects.echistory_category.pageConfig,
    });

    checkNavigation(); // we don't reliably get the pageshow event on a full load - timing issue probably
    $(window).on('pageshow', checkNavigation);
  };

  this.ready = function(){
    //Add Events
    f._each(instance.pages, function(page){
      if(page.isActive()){
        //Fire updateOn functions, if applicable
        f._each(page.elements, function(element){
          if(element.updateOn_full instanceof Function){
            element.updateOn_full(function(){
              if(!instance.initialized) return;
              if(element.opId==page.opId){
                instance.saveState({ addHistory: (element.type=='querystring_newstate'), source: element });
              }
            });
          }
        });
        //Attached updateOn_full events
        vona2.store.getActionObservable().subscribe(function(v){
          instance.triggerEventInPage(page, v.type, '_full');
        });
      }
    });
  };

  function checkNavigation() {
    if (history.state && history.state.navId) {
      var curNavId = parseInt(sessionStorage.getItem(CURRENT_NAV_ID), 10) || 1;
      if (history.state.navId < curNavId) {
        vonaLight.objects.back_action_tracking.onNavigationBackBrowser();
      }
      sessionStorage.setItem(CURRENT_NAV_ID, history.state.navId.toString());
      vonaLight.objects.back_action_tracking.onPageChange();
    } else {
      var maxNavId = parseInt(sessionStorage.getItem(MAX_NAV_ID), 10) || 1;
      history.replaceState($.extend({}, history.state, {navId: maxNavId}), '');
      sessionStorage.setItem(CURRENT_NAV_ID, maxNavId.toString());
      sessionStorage.setItem(MAX_NAV_ID, (maxNavId + 1).toString());
      vonaLight.objects.back_action_tracking.onPageChange();
    }
  }

  this.addPageConfig = function(store, pages) {
    if(!instance.isEnabled()) return;

    if(instance.initialized) instance.logDebug('New pages added to echistory after state was restored');

    f._each(pages, function(page, key) {
      instance.pageConfig[key] = page;
    });

    //Add Events
    f._each(pages, function(page){
      instance.pages.push(page);
      if(page.isActive()){

        //Fire updateOn functions, if applicable
        f._each(page.elements, function(element){
          if(element.updateOn instanceof Function){
            element.updateOn(function(){
              if(!instance.initialized) return;
              if(element.opId==page.opId){
                instance.saveState({ addHistory: (element.type=='querystring_newstate'), source: element });
              }
            });
          }
        });

        if (store) {
          //Attached updateOn events
          store.getActionObservable().subscribe(function(v){
            instance.triggerEventInPage(page, v.type);
          });
        }
      }
    });
  };

  this.triggerEvent = function(event){
    f._each(instance.pageConfig, function(page){
      if(page.isActive()){
        instance.triggerEventInPage(page, event);
      }
    });
  };

  this.triggerEventInPage = function(page, event, eventType){
    eventType = eventType || '';
    if(!instance.initialized) return;
    f._each(page.elements, function(element){
      if(element['updateOn'+eventType] instanceof Array && element['updateOn'+eventType].indexOf(event) != -1){
        if(element.opId==page.opId){
          instance.saveState({ addHistory: (element.type=='querystring_newstate'), source: element });
        }
      }
    }); 
  };

  //Returns a boolean indicating whether the element name is currently being restored
  //If called with no parameters, will return whether any elements are being restored
  this.isRestoring = function(name){
    if(!name) return (instance.restoring && instance.restoring.length);
    return instance.restoring.indexOf(name) != -1;
  };

  //Returns a boolean indicating whether the browser supports the history library
  this.isEnabled = function(){
    return !!(window.history && window.history.pushState && window.history.replaceState);
  };

  //Enable debugging mode
  //Call vona2.objects.echistory.enableDebug() from the console
  this.enableDebug = function(){
    instance.debugEnabled = true;
    vonaLight.objects.echistory_viewer.enableDebug();
  };

  //Log debug messages to the console if debugging is enabled
  this.logDebug = function(msg){
    if(instance.debugEnabled) console.log(msg); //eslint-disable-line no-console
  };

  // Add new entry to browser history
  this.pushHistoryEntry = function(entry){
    if (history.state && history.state.navId) entry.state.navId = history.state.navId;
    $(instance).triggerHandler('pushHistoryEntry', entry);
    history.pushState(entry.state,'Misumi EC',entry.url); 
  };

  // Replace current entry in browser history
  this.replaceHistoryEntry = function(entry){
    if (history.state && history.state.navId) entry.state.navId = history.state.navId;
    $(instance).triggerHandler('replaceHistoryEntry', entry);
    try{
      history.replaceState(entry.state,'Misumi EC',entry.url);
    }
    catch(ex){ console.log('Warning - Could not save history state.', ex); } //eslint-disable-line no-console
  };

  // Handle popped history entry
  this.popHistoryEntry = function(entry){
    $(instance).triggerHandler('popHistoryEntry', entry);
  };

  //Returns a state object with the current UI state
  this.getState = function(){
    var rslt = null;
    f._each(instance.pageConfig, function(page){
      if(page.isReady()){
        rslt = {};
        for(var i=0;i<page.elements.length;i++){
          var element = page.elements[i];
          rslt[element.name] = element.getState();
        }
      }
    });
    return rslt;
  };

  //Saves the target state to the current browser URL
  this.saveState = function(options){
    if(!options) options = { 
      addHistory: false,
      passThrough: false,
      source: null
    };

    var memory_fast = false;

    var state;
    if(options.source && (options.source.type=='memory_fast')){
      var element = options.source;
      memory_fast = true;
      var elementState = element.getState();
      state = $.extend({}, this.lastState);
      delete state['_initial'];
      state[element.name] = elementState;
    }
    else state = $.extend({}, instance.getState());
    if(options.passThrough) state.passThrough = true;

    f._each(instance.pageConfig, function(page){
      if(page.isReady()){
        var qvarnames = [];
        for(var i=0;i<page.elements.length;i++){
          var element = page.elements[i];
          if((element.updateOn=='CREATESTATE') && !options.addHistory && !instance.lastState._initial && (element.name in instance.lastState)){
            state[element.name] = instance.lastState[element.name];
          }
          //else delete state[element.name];
          if((element.type=='querystring') || (element.type=='querystring_newstate')) qvarnames.push(element.name);
        }

        //Extract querystring variables
        var qvars = f._pick(state, qvarnames);

        //Generate URL
        var url = window.location.href;
        if(!memory_fast){
          url = [window.location.protocol, '//', window.location.host, window.location.pathname].join('');
          var url_qs = vonaLight.functions.parseQuerystring(window.location.search);
          if(!f._isEmpty(qvars) || !f._isEmpty(url_qs)){ 
            url_qs = f._omit(url_qs, qvarnames);
            url_qs = $.extend(url_qs, qvars);
            url += '?' + $.param(url_qs);
          }
          if(window.location.hash) url += window.location.hash;
        }

        var sourceDesc = (options.source&&options.source.name)||'';
        if(!instance.isStateEqual(instance.lastState, state)){
          if(options.addHistory){
            //Create a new state
            instance.logDebug('saveState NEW - '+sourceDesc);
            page.opId++;
            for(var i=0;i<page.elements.length;i++){ // eslint-disable-line no-redeclare
              page.elements[i].opId = page.opId;
            }
            state.stateId = page.opId;
            instance.pushHistoryEntry({ url: url, state: state });
          }
          else {
            //Replace the current state
            instance.logDebug('saveState REPLACE - '+sourceDesc);
            state.stateId = page.opId;
            instance.replaceHistoryEntry({ url: url, state: state });
          }

          instance.lastState = state;
          instance.lastUrl = url;
        }
      }
    });
  };

  //Restores the target state to the current UI
  this.restoreState = function(state, cb){
    var rslt = null;
    var cb_pending = { init: true };
    var checkAllComplete = function(){
      for(var pageKey in cb_pending){
        if(cb_pending[pageKey]) return;
      }
      if(cb) cb();
    };
    f._each(instance.pageConfig, function(page, pageKey){
      if(page.isReady()){
        var page_cb = function(){};
        if(cb){
          cb_pending[pageKey] = true;
          page_cb = function(){
            cb_pending[pageKey] = false;
            checkAllComplete();
          };
        }
        var qvarnames = [];
        for(var i=0;i<page.elements.length;i++){
          var pageElement = page.elements[i];
          if((pageElement.type=='querystring') || (pageElement.type=='querystring_newstate')) qvarnames.push(pageElement.name);
        }

        var url_qs = vonaLight.functions.parseQuerystring(window.location.search);
        var queryState = $.extend({}, f._pick(url_qs, qvarnames));

        //Parse state from URL and state
        if(!state || f._keys(state).length <= 1){
          state = instance.getState();
          state.stateId = page.opId;
          state._initial = true;
          if(f._isEmpty(queryState)){
            instance.logDebug('initState REPLACE');
            instance.replaceHistoryEntry({ historyId: (state?state.historyId:null), url: window.location.href, state: state });
            instance.lastState = state;
            instance.lastUrl = window.location.href;

            for(var j=0;j<page.elements.length;j++){
              var element = page.elements[j];
              if (element.stateUnchanged instanceof Function) {
                element.stateUnchanged(state[element.name], 'undefined', state);
              }
            }
          }
          else state = {};
        }

        state = $.extend(state,queryState);

        rslt = instance.setState(page, state, page_cb);

        instance.initialized = true;
      }
    });
    if(cb){
      cb_pending['init'] = false;
      checkAllComplete();
    }
    return rslt;
  };

  //Executes "f" on each element of "arr", while "isActive()==true", and executes "cb" on completion
  this.each = function(arr, f, isActive, cb){
    if(!cb) cb = function(){};
    if(!arr || (arr.length==0)) return cb();
    var collector = [];
    instance.restoring = [];
    for (var a in arr) instance.restoring.push(arr[a].name);
    var fasync = function(val, idx){
      f(val, function(){
        if(!isActive()) return;
        collector.push(idx);
        for(var i=0;i<instance.restoring.length;i++){
          if(instance.restoring[i]==arr[idx].name){ instance.restoring.splice(i,1); i--; }
        }
        for(var i=0;i<arr.length;i++){ // eslint-disable-line no-redeclare
          var found = false;
          for(var j=0;j<collector.length;j++){
            if(collector[j]==i){ found=true; break; } 
          }
          if(!found) return;
        }
        cb();
      });
    };
    for(var k=0;k<arr.length;k++){
      fasync(arr[k], k);
    }
  };

  //Returns true if the states are equal using a deep equality comparison.  Exclude unique history properties.
  this.isStateEqual = function(a, b){
    var excludeProps = ['stateId','historyId','navId','_initial'];
    return f._isEqual(f._omit($.extend({}, a),excludeProps),f._omit($.extend({}, b),excludeProps));
  };

  //Updates the UI with the target state
  this.setState = function(page, newState, cb){
    if(!cb) cb = function(){};
    if(!this.isStateEqual(this.lastState, newState)){
      var lastStateOnEntry = this.lastState;
      var dir = 'forward';
      if(newState && this.lastState && (newState.stateId < this.lastState.stateId)) dir = 'back';
      else if(!newState || !this.lastState || !('stateId' in newState) || !('stateId' in this.lastState)) dir = 'undefined';
      instance.logDebug('Restoring state...'+dir);
      if (dir == 'back') vonaLight.objects.back_action_tracking.onNavigationBackEchistory();
      //Click on title to close any drop-down menus / content, such as "How can we improve?"
      $('.m-h1:visible').first().click();
      page.opId++;
      var curOpId = page.opId;
      this.lastState = newState;
      for(var i=0;i<page.elements.length;i++){
        page.elements[i].opId = curOpId-1;
      }
      var restoreElements = [];
      instance.each(page.elements, function(element, element_cb){ //f per item
        if(!(element.setState instanceof Function)) return element_cb();
        var cmpl_check_opid = function(){
          if(element.opId==(curOpId-1)){ element.opId = curOpId; }
          for(var i=0;i<page.elements.length;i++){ 
            if(page.elements[i].setState==element.name) { page.elements[i].opId = curOpId; } 
          }
          element_cb();
        };
        if(element.name in newState){
          var restoreElement = false;
          if(element.restoreOn instanceof Array && element.restoreOn.indexOf(dir) != -1) restoreElement = true;
          else if(element.restoreOn instanceof Function && element.restoreOn(dir, restoreElements, newState)) restoreElement = true;
          //Do not restore the element if it is not changed
          if(newState && lastStateOnEntry && f._isEqual(lastStateOnEntry[element.name], newState[element.name])) restoreElement = false;
          //Perform the restore operation
          if(restoreElement){
            restoreElements.push(element.name);
            return element.setState(newState[element.name], dir, cmpl_check_opid, newState);
          } else if (element.stateUnchanged instanceof Function) {
            element.stateUnchanged(newState[element.name], dir, newState);
          }
        }
        return cmpl_check_opid();
      }, function(){ //isActive
        return page.opId == curOpId;
      }, function(){
        instance.logDebug('Page op complete');
        cb();
      });
    }
    else return cb();
  };

  //Handle the browser back/forward button event
  function echistory_popstate(e){
    if(!instance.isEnabled()) return;

    var wasPassThrough = instance.lastState.passThrough;

    var vonax = getVona();
    if(vonax){
      //If a modal dialog box is open
      if(vonax.functions.isModalVisible()){
        //Push new state to history, to counter the removed state
        var currentEntry = { url: instance.lastUrl, state: instance.lastState };
        instance.popHistoryEntry({ historyId: (e.state?e.state.historyId:null), url: window.location.href, state: e.state });
        instance.pushHistoryEntry(currentEntry);
        //Hide the modal
        vonax.functions.hideAnyModal();
        return;
      }
    }

    $('.tooltipMessage').stop().hide();

    //Update the history tracking array
    instance.popHistoryEntry({ historyId: (e.state?e.state.historyId:null), url: window.location.href, state: e.state });
    //If this is a "passThrough" state (empty state created by the modal), click "back" again
    if(wasPassThrough){
      history.back();
      return;
    }
    //Restore the state
    instance.restoreState(e.state);
  }
};

