    });
  };

  //History Viewer Debugging Tool: Expand / Contract the History Viewer
  this.toggleHistoryViewer = function(){
    var isVisible = $('#historyTable').is(':visible');
    if(isVisible){
      //Hide
      $('#historyViewer').css({ width: '90px', height: '20px', overflow: 'hidden', left:'auto' });
      $('#historyTable').hide();
    }
    else {
      //Show
      $('#historyViewer').css({ width: '300px', height: '400px', overflow: 'auto' });
      $('#historyTable').show();
    }
  };

  //History Viewer Debugging Tool: Render History Table
  this.renderHistoryViewer = function(){
    $('#historyTable').empty();
    for(var i=this.historyEntries.length-1;i>=0;i--){
      var historyEntry = this.historyEntries[i];
      var row = $('<div data-historyid="'+historyEntry.historyId+'">'+historyEntry.historyId+':'+historyEntry.url+'</div>');
      if(i==this.currentHistoryEntryIndex){
        row.css({'background-color':'yellow'});
      }
      $('#historyTable').append(row);
    }
    $('#historyTable div').each(function(){
      $(this).click(function(){
        var jobj = $(this);
        var historyId = parseInt(jobj.data('historyid'));
        var historyEntry = null;
        var historyEntries = instance.historyEntries;
        for(var i=0;i<historyEntries.length;i++) if(historyEntries[i].historyId==historyId) historyEntry = historyEntries[i];
        if(!historyEntry) return;
        historyEntry = JSON.parse(JSON.stringify(historyEntry));
        if(historyEntry.state && historyEntry.state.curSearch) historyEntry.state.curSearch = JSON.parse(historyEntry.state.curSearch);
        console.log(historyEntry); //eslint-disable-line no-console
      });
    });
  };

  // History Viewer Debugging Tool: Add new entry to browser history
  this.pushHistoryEntry = function(entry){
    entry.historyId = this.historyEntries[this.currentHistoryEntryIndex].historyId+1;
    //Delete any history states with historyId >= entry.historyId
    for(var i=0;i<this.historyEntries.length;i++){
      if(this.historyEntries[i].historyId >= entry.historyId){
        this.historyEntries.splice(i,1);
        i--;
      }
    }
    //Add history entry to stack
    this.historyEntries.push(entry);
    this.currentHistoryEntryIndex++;
    this.renderHistoryViewer();
    entry.state.historyId = entry.historyId;
  };

  //History Viewer Debugging Tool: Replace current entry in browser history
  this.replaceHistoryEntry = function(entry){
    if(!entry.historyId) entry.historyId = this.historyEntries[this.currentHistoryEntryIndex].historyId;
    this.historyEntries[this.currentHistoryEntryIndex] = entry;
    this.renderHistoryViewer();
    entry.state.historyId = entry.historyId;
  };

  //History Viewer Debugging Tool: Handle popped history entry
  this.popHistoryEntry = function(entry){
    if(!entry){ console.warn('ERROR - Cannot restore null entry'); return; } //eslint-disable-line no-console
    if(!entry.historyId){ console.warn('ERROR -  Popped entry missing historyId'); return; } //eslint-disable-line no-console

    if(entry.historyId < this.historyEntries[0].historyId){
      //Add item to beginning of historyEntries
      this.historyEntries.unshift(entry);
      this.currentHistoryEntryIndex = 0;
    }
    else if(entry.historyId > this.historyEntries[this.historyEntries.length-1].historyId){
      //Add item to end of historyEntries
      this.historyEntries.push(entry);
      this.currentHistoryEntryIndex = this.historyEntries.length-1;
    }
    else{
      //Add item to middle of historyEntries
      for(var i=0;i<this.historyEntries.length;i++){
        if(this.historyEntries[i].historyId >= entry.historyId){
          if(this.historyEntries[i].historyId == entry.historyId) this.historyEntries[i] = entry;
          else this.historyEntries.splice(i,0,entry);
          this.currentHistoryEntryIndex = i;
          break;
        }
      }
    }

    this.renderHistoryViewer();
  };

