    return s;
  }

  function captureElements() {
    $header = $('[data-component=header]');

    $content = $('[data-keyword-suggest=content]');

    $clearButton = $('[data-keyword-suggest=clear]');

    $typeCode = $('[data-keyword-suggest=typeCode]');
