    $partNumber.find('[data-item=container]').empty();
  }

  var renderHtmlList = vonaLight.functions.renderHtmlList;

  function getName( e ) {
    var type = e.partNumberType;
    var brand;
    if (e.brandName && e.seriesName) brand = e.brandName + ':' + e.seriesName;
    else if (e.brandName) brand = e.brandName;
    else if (e.seriesName) brand = e.seriesName;
    else brand = '';
    if( type == PART.NORMAL || type == PART.DISCON ) // Standard Part Number,End of sales product.
      return e.partNumber + ( brand ? ' ['+ brand +']' : '' );
    else if( type == PART.NOLIST) {//Product without Information Posted
      return e.partNumber + (brand ? ' ['+ brand +']' : '') + ' ' + e.partNumberTypeDisp;
    }
    else if( type == PART.NOCATALOG) //Product not Listed in Catalog
      return e.partNumber + ' ['+ brand +' '+ e.partNumberTypeDisp + ']';
    else if( type == PART.CNAVI) // C Navi
      return e.partNumber + ' ['+ brand +' '+ e.partNumberTypeDisp + ']';
  }

  function getUrl( e, s ) {
    var ret = '', type = e.partNumberType, pn = e.partNumber;

    if( type == PART.NOLIST) return '#'; //Product without Information Posted
    else if( type == PART.DISCON ) // End of sales product
      ret = s.vona2_path + '/result/?' + $.param({Keyword: pn});
    else
      ret = s.vona2_path + '/detail/' + e.seriesCode + '/?'
      + $.param({PNSearch: pn, HissuCode: pn, searchFlow: 'suggest2products', Keyword: pn});
    return ret;
  }

  function updateSearchButton(s) {
    if(!s) return;

    var flg = s.typeCode.isVisible && s.q;
    var dest = flg ? -44 : 0;

    $('#keyword_btn').stop( true, true ).animate({marginTop: dest}, 170)
      .find('#typecode_go').attr({tabindex: flg ? '':'-1' }).end()
      .find('#keyword_go' ).attr({tabindex: flg ? '-1':'' }).end();
  }
  var updateSearchButton200 = debounceFor(200, updateSearchButton);

  // designed around a state object that describes the current state, this function makes the dom match. A notable exception is currently selected item updates, which occur directly.
  function render( s ) {
    //console.log('render', s);
    var $container;

    // set a context for class for possible layout adjustments in the containing header
    $header.toggleClass('l-header--searchOpen', s.isVisible);

    var showResults = s.isVisible && (s.len || s.keywordIsLoading || s.partNumber.isLoading);
    $content.toggleClass('VN_none', !showResults);

    if(!showResults && $input && !$input.val()){
      var ksp = window.vona2 && window.vona2.objects && window.vona2.objects.keyword_suggest_preview;
      if(ksp) ksp.selectNothing();
    }

    $typeCode.toggleClass('VN_none', !s.typeCode.isVisible);
    renderHtmlList($typeCode, $typeCodeTemplate, s.typeCode.list, function(i, item, $el) {
      $el.find('[data-item=type]')
        .text(item.forwardTypeDisp);
      $el.find('[data-partnumber]')
        .attr('href', item.forwardPageUrl)
        .attr('data-partnumber', item.keyword);
      if (item.forwardImageUrl) {
        $el.find('[data-item=image]')
          .removeClass('VN_none')
          .attr('src', item.forwardImageUrl);
      } else {
        $el.find('[data-item=image]')
          .addClass('VN_none');
      }
      $el.find('[data-item=category]')
        .text(item.forwardTitle);
      $el.find('[data-item=code]')
        .text(item.keyword);
    });

    $keyword.toggleClass('VN_none', !s.keyword.isVisible);
    $container = $keyword.find('[data-item=container]');
    renderHtmlList($container, $keywordTemplate, s.keyword.list, function(i, item, $el) {
      $el.find('[data-keyword-suggest=keywordLink]')
        .attr('id', 'keyword_keywordSuggest_'+i)
        .attr('data-keyword-type', item.type)
        .attr('data-keyword-value', item.keyword)
        .attr('href', s.vona2_path+'/result/?Keyword='+encodeURIComponent(item.keyword))
        .text(item.keyword);
    });

    $category.toggleClass('VN_none', !s.category.isVisible);
    $container = $category.find('[data-item=container]');
    renderHtmlList($container, $categoryTemplate, s.category.list, function(i, item, $el) {
      $el.find('[data-keyword-suggest=categoryLink]')
        .attr('id', 'keyword_categorySuggest_'+i)
        .attr('data-keyword-type', item.type)
