    $container = $partNumber.find('[data-item=container]');
    renderHtmlList($container, $partNumberTemplate, s.partNumber.list, function(i, item, $el) {
      $el.find('[data-keyword-suggest=partNumberLink]')
        .attr('id', 'keyword_productCode_'+i)
