/* JS for keyword cookie tracking to support Search Performance Reporting */
var keywordTrackingClass = function(functions){
  var COOKIE_ID = 'MISUMI_SEARCH_PERFORMANCE';
  var keyword = '', keywordID = undefined;
  var lastSearchResultClickID = 0;
  var lastSearchResultClick = '';

  // init is useless. We might be called from vonaLight_Spec before getting inited.
  this.initLight = function(){};

  this.init = function(){};

  this.getInitialState = function(){ return { data: null}; };

  this.ready = function() {
    readCookie();
    vonaLight.objects.back_action_tracking.keywordIdAssigned(keyword, keywordID);
  };

  //Read modal cookie
  function readCookie() {
    //Session Cookie
    var cookieStr = (functions.getCookieValue(COOKIE_ID) || '___{}').substr(3);
    var cookieData = {};
    try{ cookieData = JSON.parse(cookieStr); }
    catch(ex){ /* eslint-disable-line no-empty */ }

    keyword = cookieData.keyword || '';
    keywordID = cookieData.keywordID || undefined;
    lastSearchResultClickID = cookieData.lastSearchResultClickID || 0;
    lastSearchResultClick = cookieData.lastSearchResultClick || '';
  }

  //Write modal cookie
  function writeCookie(){
    var cookieData = {
      keyword: keyword,
      keywordID: keywordID,
      lastSearchResultClickID: lastSearchResultClickID,
      lastSearchResultClick: lastSearchResultClick
    };
    functions.setCookieValue(COOKIE_ID, '___'+JSON.stringify(cookieData), null, '/' );
  }

  function setKeyword(_keyword){
    readCookie();
    keyword = (_keyword || '').trim().toLowerCase();
    keywordID = getCachedKeywordId(keyword) || Date.now().toString() + '_' + Math.round(Math.random()*1000000000).toString();
    clearCachedKeywordId();
    lastSearchResultClickID = 0;
    lastSearchResultClick = '';
    writeCookie();
    if(keyword) vonaLight.objects.back_action_tracking.keywordChanged(keyword);
    vonaLight.objects.back_action_tracking.keywordIdAssigned(keyword, keywordID);
  }

  function setLastSearchResultClick(label){
    readCookie();
    lastSearchResultClickID++;
    lastSearchResultClick = label;
    writeCookie();
  }

  function clearCachedKeywordId(){
    if(window.sessionStorage){
      sessionStorage.removeItem(COOKIE_ID+'_TMP_KEYWORD');
      sessionStorage.removeItem(COOKIE_ID+'_TMP_KEYWORDID');
    }
  }

  function getCachedKeywordId(_keyword){
    if(window.sessionStorage){
      if(sessionStorage.getItem(COOKIE_ID+'_TMP_KEYWORD')==_keyword){
        var tempKeywordID = sessionStorage.getItem(COOKIE_ID+'_TMP_KEYWORDID');
        if(tempKeywordID) return tempKeywordID;
      }
    }
    return null;
  }

  this.getTempKeywordId = function(_keyword){
    readCookie();
    if(!_keyword) return '';
    if(keyword == _keyword) return keywordID;
    var tempKeywordID = getCachedKeywordId(_keyword);
    if(tempKeywordID) return tempKeywordID;
    tempKeywordID = Date.now().toString() + '_' + Math.round(Math.random()*1000000000).toString();
    if(window.sessionStorage){
      sessionStorage.setItem(COOKIE_ID+'_TMP_KEYWORD',_keyword);
      sessionStorage.setItem(COOKIE_ID+'_TMP_KEYWORDID',tempKeywordID);
    }
    return tempKeywordID;
  };

  this.resetSearchKeyword = function(){
    setKeyword('');
  };

  this.getKeyword = function(){
    readCookie();
    return keyword;
  };

  this.getKeywordID = function(){
    readCookie();
    return keywordID || '';
  };

  this.ifKeywordChanged = function(newKeyword, ifChanged) {
    readCookie();
    if (keyword != newKeyword) {
      //Set cookie based on search query
      setKeyword(newKeyword);
      ifChanged();
    }
  };

  this.getLastSearchResultClickID = function(){
    readCookie();
    return lastSearchResultClickID || '';
  };

  this.ifSearchResultClickChanged = function(newLabel, ifChanged) {
    readCookie();
    if (lastSearchResultClick != newLabel) {
      //Set cookie to remember the last page logged
      setLastSearchResultClick(newLabel);
      ifChanged();
    }
  };
}
