var logHsAnalyticsClass = function(){

  var instance = this;
  this.debugEnabled = false;
  this.isInitialized = false;

  this.initLight = function() {
    instance.debugEnabled = vonaLight.functions.getCookieValue('DEV');
    instance.isInitialized = true;

    initOnLoadEvent();
  };

  this.ready = function() {
    initTrackAddToCartEvent();
  };

  this.logAutocomplete = function(searchQuery, value, url, suggestType) {
    var data = {
      Keyword: searchQuery,
      Name: value,
      SuggestType: suggestType,
      Url: url
    };

    send('AutocompleteClick', data);
  };

  this.logClick = function(trackingId, url, uniqueId, event) {

    /** @type {HTMLElement} */
    var element = event.currentTarget;

    var data = {
      Mlt: false,
      MouseX: event.pageX,
      MouseY: event.pageY,
      Qs: getQueryString(),
      RequestPath: window.location.pathname,
      ScrollX: document.documentElement.scrollLeft || document.body.scrollLeft,
      ScrollY: document.documentElement.scrollTop || document.body.scrollTop,
      TrackingId: trackingId,
      UniqueId: uniqueId,
      Url: url,
      ViewportHeight: getViewPortHeight(),
      ViewportWidth: getViewPortWidth(),
      ElementClass: element.className,
      ElementId: element.id,
      ElementTag: element.tagName,
      ElementType: element.tagName,
      ElementX: window.scrollX + element.getBoundingClientRect().left,
      ElementY: window.scrollY + element.getBoundingClientRect().top,
    };

    send('Click', data);
  };

  this.logPageLoad = function(pageTypeId, uniqueId){

    var data = {
      PageTypeId: pageTypeId.toString(),
      Qs: getQueryString(),
      RequestPath: window.location.pathname,
      ViewportHeight: getViewPortHeight(),
      ViewportWidth: getViewPortWidth()
    };

    if (uniqueId != null) {
      data.UniqueId = uniqueId.toString();
    }

    send('PageLoad', data, true);
  };

  this.logSearch = function(trackingId, isInitialResult, queryId) {
    var data = {
      TrackingId: trackingId,
      TypeId: isInitialResult ? '1' : '2',
      QueryId: queryId,
      Qs: getQueryString(),
      RequestPath: window.location.pathname,
      ViewportHeight: getViewPortHeight(),
      ViewportWidth: getViewPortWidth()
    };

    send('Search', data);
  };

  this.logRecommendationClick = function(itemIndex, requestId, seriesCode, widgetGuid) {
    var data = {
      ItemIndex: itemIndex,
      RequestId: requestId,
      UniqueId: seriesCode,
      WidgetGuid: widgetGuid
    };

    send('RecommendationClick', data);
  };

  //Enable debugging mode
  //Call vonaLight.objects.log_hs_analytics.enableDebug() from the console
  this.enableDebug = function(){
    instance.debugEnabled = true;
    vonaLight.functions.setCookieValue('DEV',1,null,'/');
  };

  function createUuid() {

    function getBytes(length) {
      var bytes = [];
      for (var i = 0; i < length; i++) bytes.push(Math.floor(Math.random() * 256));
      return bytes;
    }

    function toHex(bytes) {
      return bytes
        .map(function(byte){ return (byte >> 4).toString(16) + (byte & 0x0f).toString(16); })
        .join('');
    }

    var timeHiAndVersion = getBytes(2);
    timeHiAndVersion[0] = (timeHiAndVersion[0] & 0x0f) | 0x40;

    var clockSeqHiAndReserved = getBytes(1);
    clockSeqHiAndReserved[0] = (clockSeqHiAndReserved[0] & 0x3f) | 0x80;

    return [
      toHex(getBytes(4)),
      toHex(getBytes(2)),
      toHex(timeHiAndVersion),
      toHex(clockSeqHiAndReserved) + toHex(getBytes(1)),
      toHex(getBytes(6))
    ].join('-');
  }

  this.getClientGuid = function() {

    // Try to get config data from vona2. This might not be loaded yet.
    var _vona2 = window.vona2 || {};
    var clientGuid = _vona2.config && _vona2.config.api && _vona2.config.api.hawksearch
      ? _vona2.config.api.hawksearch.client_guid
      : '';

    if (clientGuid) return clientGuid;

    // If window.hawksearch.client_guid  is not defined,
    // it means common/app/include/hawksearch_config.twig
    // has not been included on the page. The fix is to include the twig file on the current page.
    return (window.hawksearch)
      ? window.hawksearch.client_guid
      : '';
  };

  function getCookie(name) {
    var cookies = (document.cookie || '').split(';');
    for (var i = 0; i < cookies.length; i++) {
      var parts = cookies[i].split('=');
      if (parts[0].trim() === name) return (parts[1] || '').trim();
    }
    return undefined;
  }

  function getQueryString() {
    return decodeURIComponent(window.location.search.replace(/^\?/, ''));
  }

  function getTrackingApiUrl() {

    // Try to get config data from vona2. This might not be loaded yet.
    var _vona2 = window.vona2 || {};
    var url = _vona2.config && _vona2.config.api && _vona2.config.api.hawksearch
      ? _vona2.config.api.hawksearch.tracking_api_base
      : '';

    if (url) return url + 'trackevent';

    // If window.hawksearch.tracking_api_base  is not defined,
    // it means common/app/include/hawksearch_config.twig
    // has not been included on the page. The fix is to include the twig file on the current page.
    return (window.hawksearch)
      ? window.hawksearch.tracking_api_base + 'trackevent'
      : '';
  }

  function getViewPortHeight() {
    return window.innerHeight;
  }

  function getViewPortWidth() {
    return window.innerWidth;
  }

  this.getVisitId = function() {
    var cookieName = 'hs_visitId';
    var visitId = getCookie(cookieName) || '';
    if (visitId.length < 1) {
      visitId = createUuid();
      var expires = new Date();
      // 4 hours
      expires.setTime(expires.getTime() + (4 * 60 * 60 * 1000));
      document.cookie = cookieName + '=' + visitId + '; expires=' + expires.toUTCString() + '; path=/';
    }
    return visitId;
  };

  this.getVisitorId = function() {
    var cookieName = 'hs_visitorId';
    var visitorId = getCookie(cookieName) || '';
    if (visitorId.length < 1) {
      visitorId = createUuid();
      var expires = new Date();
      // 1 year
      expires.setTime(expires.getTime() + (365 * 24 * 60 * 60 * 1000));
      document.cookie = cookieName + '=' + visitorId + '; expires=' + expires.toUTCString() + '; path=/';
    }
    return visitorId;
  };

  function initOnLoadEvent() {

    var $body = $('body');
    if ($body.attr('data-spec') === 'results-hawksearch' || $body.hasClass('categoryListing')) {
      // Result page
      instance.logPageLoad(5, undefined);
    } else if ($body.hasClass('category')) {
      if ($body.hasClass('maker')) {
        // Brand page
        instance.logPageLoad(5, undefined);
      } else if ($body.hasClass('makerTemplate')) {
        // Brand category page
        instance.logPageLoad(5, undefined);
      } else {
        // Category page
        instance.logPageLoad(5, undefined);
      }
    } else if ($body.hasClass('spec')){
      // Spec search page
      var specType = $body.attr('data-spec');
      if((specType == 'spec') || (specType == 'makerSpec') || (specType == 'custom')){
        instance.logPageLoad(5, undefined);
      }
      var init = ($body.attr('data-init')||'').toString().split(' ');
      for(var i=0;i<init.length;i++){
        if((init[i] == 'npnl-part-number-listing') || (init[i] == 'npnl-subcategory-listing')){
          instance.logPageLoad(5, undefined);
          break;
        }
      }
    } else if ($body.hasClass('selector-ball-bearings') || $body.hasClass('specCenter')) {
      // bearing finder
      instance.logPageLoad(5, undefined);
    } else if ($body.hasClass('detail')) {
      // Detail page
      instance.logPageLoad(1, VNServerInfo.seriesCode);
    }
  }

  function initTrackAddToCartEvent() {
    // IE11 does not work with set initializer. Add items individually.
    var add2CartTypes = new Set();
    add2CartTypes.add('LOG_HS_ADD_CART_ORDERPAD');
    add2CartTypes.add('ADD_CART_DONE');
    add2CartTypes.add('ADD_CART_CSPEC_DONE');
    vona2.store.getActionObservable()
      .filter(function(v){ return add2CartTypes.has(v.type); })
      .subscribe(function(v){
        var itemList = v.payload.cartItemList || [];
        var items = itemList
          .filter(function(item) {
            return item.unitPrice && item.seriesCode;
          })
          .map(function(item){
            return {
              Price: item.unitPrice,
              Quantity: item.quantity,
              UniqueId: item.seriesCode,
              Currency: item.currencyCode
            };
          });

        if (items.length < 1) return;
        if(items.length == 1) {
          send('Add2Cart', items[0]);
        } else {
          send('Add2CartMultiple', { ItemsList: items });
        }
      });
  }


  var queuedEvents = [];

  function send(eventType, eventData, priority) {
    var _f = eventType ? function(){ _send(eventType, eventData); } : null;
    if(instance.isInitialized){
      if(_f){ queuedEvents[priority ? 'unshift' : 'push'](_f); }
      if(queuedEvents.length){
        var toRun = queuedEvents;
        queuedEvents = [];
        for(var i=0;i<toRun.length;i++) toRun[i]();
      }
    }
    else {
      if(!_f) window.setTimeout(send, 100);
      else {
        if(_f){ queuedEvents[priority ? 'unshift' : 'push'](_f); }
        if(queuedEvents.length==1){ window.setTimeout(send, 100); }
      }
    }
  }

  function _send(eventType, eventData) {

    var clientGuid = instance.getClientGuid();

    var body = {
      ClientGuid: clientGuid,
      VisitId: instance.getVisitId(),
      VisitorId: instance.getVisitorId(),
      EventType: eventType,
      // This will be base64 encoded before sending.
      // Keep as object for logging.
      EventData: eventData
    };

    if (!clientGuid) {
      console.warn('Hawksearch client GUID is not set. Event will not be sent.', body); //eslint-disable-line no-console
      return;
    }

    var url = getTrackingApiUrl() || '';
    if (!url) {
      console.warn('Hawksearch tacking API URL is not set. Event will not be sent.', body); //eslint-disable-line no-console
      return;
    }

    if (instance.debugEnabled) {
      console.log(JSON.stringify(body, null, 4)); //eslint-disable-line no-console
    }

    body.EventData = btoa(unescape(encodeURIComponent(JSON.stringify(eventData))));

    $.ajax({
      contentType: ' application/json',
      data: JSON.stringify(body),
      method: 'POST',
      error: function(jqXhr, status, errorMessage) {
        var message = (jqXhr && jqXhr.responseJSON && jqXhr.responseJSON.Message) || errorMessage;
        console.error(new Error(message), body, eventData); //eslint-disable-line no-console
      },
      success: function(data, str, jqXhr) {},
      url: url
    });
  }

};
