/* JS for Sitewide notice (e.g. privacy policy) */
var noticeSitewideClass = function(functions){
  var COOKIE_ID = 'MISUMI_SITEWIDE_NOTICE';
  var cookieData = {};
  var f = functions;

  this.initLight = function(){
    readCookie();
  };

  this.init = function() {
    f = vona2.functions;
  };

  this.getInitialState = function(){ return { data: null}; };

  this.readyLight = function() {
    $('[data-notice]').each(function() {
      var _noticeID = $(this).data('notice');
      if (!_noticeID) return;

      var cd = cookieData[_noticeID] || {};
      cd.closeCount = cd.closeCount || 0;
      cd.disabled = cd.disabled || false;
      cd.closed = cd.closed || false;
      //If the notice has been opted out or closed, continue to the next notice
      if(cd.disabled){
        if(cd.expiration && (cd.expiration > (new Date()).getTime())){
          return $(this).remove();
        }
      }
      if(cd.closed) return $(this).remove();
    });

    $('[data-notice-group=group]')
      .on('click', '[data-action-btn]', noticeAction)
      .removeClass('VN_none');
  };

  this.ready = function() {
    this.off(vona2.events.LOGINED).on(vona2.events.LOGINED, function(){ clearLoggedOutNotices(); });
  };

  //actions to notice elements
  function noticeAction(e) {
    e.preventDefault();
    var action = $(this).data('action-btn');
    var noticeID = $(this).closest('[data-notice]').data('notice');
    $(this).closest('[data-notice]').remove();
    if (!noticeID) return;
    switch (action){
      case 'acceptPrivacyPolicy': acknowledgeNotice(noticeID); break;
    }
  }

  //Mark notice to not reappear
  function acknowledgeNotice(noticeID) {
    //Disable modal for future sessions
    if (!cookieData[noticeID]) {
      cookieData[noticeID] = {
        closeCount: 0,
        disabled: false,
        closed: false,
      };
    }

    cookieData[noticeID].disabled = true;
    cookieData[noticeID].expiration = (new Date()).getTime() + 365 * 24 * 60 * 60 * 1000;
    writeCookie();
  }

  //Clear all logged-out notices
  function clearLoggedOutNotices() {
    $('[data-notice-guest]').remove();
  }

  //Read notice cookie
  function readCookie() {
    //Persistent Cookie
    //{ 'MexicoLaunch':{closeCount: 0, disabled: false} }
    var persistentCookieStr = (f.getCookieValue(COOKIE_ID) || '___{}').substr(3);
    try{ cookieData = JSON.parse(persistentCookieStr); }
    catch(ex){ /* eslint-disable-line no-empty */ }
    if(!cookieData) cookieData = {};

    //Session Cookie
    //{ 'MexicoLaunch':{closed: true} }
    var sessionCookieStr = (f.getCookieValue(COOKIE_ID+'_SESSION') || '___{}').substr(3);
    var sessionCookieData = {};
    try{ sessionCookieData = JSON.parse(sessionCookieStr); }
    catch(ex){ /* eslint-disable-line no-empty */ }
    if(!sessionCookieData) sessionCookieData = {};
    for(var _noticeID in sessionCookieData){
      cookieData[_noticeID].closed = sessionCookieData[_noticeID].closed;
    }
  }

  //Write notice cookie
  function writeCookie(){
    var persistentCookieData = JSON.parse(JSON.stringify(cookieData));
    var sessionCookieData = {};
    for(var _modelID in persistentCookieData){
      if(persistentCookieData[_modelID].closed){
        sessionCookieData[_modelID] = { closed: true };
      }
      delete persistentCookieData[_modelID]['closed'];
    }
    f.setCookieValue(COOKIE_ID, '___'+JSON.stringify(persistentCookieData), 365, '/' );
    f.setCookieValue(COOKIE_ID+'_SESSION', '___'+JSON.stringify(sessionCookieData), null, '/' );
  }
}
;
