  });

  function windowSizeFit() {
    if(isIE67) return false;

    var narrow = $(window).width() <= windowSwithBorder;
    if(window.VNwindowNarrow !== narrow) {
      if(narrow) {
        window.VNwindowNarrow = true;
        $('body').addClass('page1');
        $('body').removeClass('page2');
      } else {
        window.VNwindowNarrow = false;
        $('body').addClass('page2');
        $('body').removeClass('page1');
      }
    }
