    });

    /*===Window RESIZE and fix for iOS mobile triggering resize events on scroll===*/
    //first store window width
    var windowInnerWidth = $(window).innerWidth();
    // Resize Event
    $(window).resize(function(){
      // Resize with iOS Fix: Check window width has actually changed and it's not just an iOS triggering a resize event on scroll
      if ($(window).innerWidth() != windowInnerWidth) {
        // Update the windowInnerWidth for next time
