        }
      }
      // Otherwise do nothing, it's just an iOS trigger of resize 
    });/*End window.resize*/

    /*===Window RESIZE page class switching LIGHT VERSION; overridden in function.js ===*/
    $(window).on('resize.light', windowSizeFit);
